:191\' lang=\"IN\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal;tab-stops:72.0pt 180.0pt\"><span style=\'font-family:\"Arial\",sans-serif;color:#404040;mso-themecolor:text1;\r\nmso-themetint:191\' lang=\"IN\">Demikian disampaikan untuk dapat diketahui dan\r\nditindaklanjuti, selamat bekerja.</span></p></p>\n', '2023-01-03', 'e-2/ND-KEU/POJ/I/2023', 2, NULL, '0', NULL, '2023-01-02 21:44:27', '2023-01-02 21:44:27', '4c89a5ea-58fa-44c9-9432-8ecce7959da0', '4c89a5ea-58fa-44c9-9432-8ecce7959da0');
